(14, 'NZ Industry Ltd', 'info@nz-bd.com', '880-2-9889078', '889078', 'TIN-20220531', 'T-2022054', 'BIN-20220531', '543', 'Email: info@nz-bd.com', 'CA Knitwear Ltd.', '2-9289053', NULL, NULL, '2-9289053', 'upload/supplier-authorization-letter/2022/06/15/737150622063138.PNG', '2022-06-15 12:31:38', '2022-06-15 12:31:38', '<p>&ldquo;Terms and Conditions&rdquo; is the document governing the&nbsp;<strong>contractual relationship between the provider of a service and its user</strong>. On the web, this document is often also called &ldquo;Terms of Service&rdquo; (ToS), &ldquo;Terms of Use&rdquo;, EULA (&ldquo;End-User License Agreement&rdquo;), &ldquo;General Conditions&rdquo; or &ldquo;Legal Notes&rdquo;.</p>\r\n\r\n<p>The Terms and Conditions are nothing other than a contract in which the owner clarifies the conditions of use of its service. Some quick examples are the&nbsp;<strong>use of the content (copyright)</strong>&nbsp;, the&nbsp;<strong>rules that users must follow while interacting with one another</strong>&nbsp;on the website / app and, finally, rules related to the&nbsp;<strong>cancellation or suspension of a user&rsquo;s account</strong>&nbsp;etc.</p>\r\n\r\n<p>Particular emphasis should be given to the&nbsp;<strong>limitation of liability clauses (and disclaimers)</strong>&nbsp;, for example the case of malfunctions of the app or website.</p>\r\n\r\n<p><strong>The Terms and Conditions therefore, represent the document that helps in dealing with problems or preventing them in the first place. Because of that, the Terms and Conditions are fundamental in many cases in order to mount an adequate and proper defense</strong>.</p>', 'yes', 'Inactive', 72, 72),
(15, 'ZM Industry Ltd', 'zm@zm.com', '01735133961', '01735133961', 'TIN:5050', 'TD:5050', 'SUP:5050', '2', 'www.zmbdcom', 'Zinnah and Mhafuj', '5050420', 'upload/supplier-owner-photo/2022/06/19/790190622051219.jpg', NULL, '01735133961', 'upload/supplier-authorization-letter/2022/06/19/949190622051219.pdf', '2022-06-19 11:12:19', '2022-06-19 11:12:19', '<ul>\r\n	<li>A Terms &amp; Conditions agreement prevents users from abusing your service (or other users of your service), limits liability, and establishes any ownership in your trademarks, content, copyrights, and other intellectual property.</li>\r\n	<li>If you do not address these reasons&nbsp;<strong>at a minimum</strong>, you will limit your legal enforcement powers and claims against users.</li>\r\n	<li>As you write your Terms &amp; Conditions agreement,&nbsp;<strong>keep these reasons in mind</strong>. It will help you avoid adding unnecessary material and&nbsp;help keep you focused.</li>\r\n	<li>The rest of this article addresses specific clauses that help you protect your interests.</li>\r\n</ul>', 'yes', 'Inactive', 72, 72);
